import React from 'react';

class Fish extends React.Component {
  render() {
    const { image, name } = this.props.details

    return (
    <li className="menu-fish">Fish
      <img src={details.image} alt={details.name}/>
      <h3 className="fish-name">{details.name}</h3>
    </li>
    )
  }
}

export default Fish;
